description:
@PicklesThePolak and @Ryan Gelley talk cult movies, horror, science fiction, exploitation, canuxploitation, kaiju, kung-fu/hong kong, chambara, grindhouse, surrealist, and any other genres your momma hates.

Episode 001 - All 7 Saw movies.  We discuss them chronologically and reveal why you may want to see them OR avoid them completely.

In August, Episode 002 - The films of Mark L Lester
